var ButtonComponent = React.createClass({
    getInitialState: function() {
        return {
            numClicks: 0
        }
    },
    click: function() {
        this.setState({ numClicks: this.state.numClicks + 1 });
    },
    render: function() {
        return  (
            <div>
                <button onClick={this.click.bind(this)}>Click Me</button>
                {this.state.numClicks}
            </div>
        );
    }
});
